package model.entity;import javax.persistence.*;@Entity@Table(name = "roles", schema = "", catalog = "registru")public class RolesEntity {    private long idRole;    private String role;    private String roleName;    @Id    @Column(name = "id_role", nullable = false, insertable = true, updatable = true)    public long getIdRole() {        return idRole;    }    public void setIdRole(long idRole) {        this.idRole = idRole;    }    @Basic    @Column(name = "role", nullable = false, insertable = true, updatable = true, length = 250)    public String getRole() {        return role;    }    public void setRole(String role) {        this.role = role;    }    @Basic    @Column(name = "role_name", nullable = false, insertable = true, updatable = true, length = 250)    public String getRoleName() {        return roleName;    }    public void setRoleName(String roleName) {        this.roleName = roleName;    }    @Override    public boolean equals(Object o) {        if (this == o) return true;        if (o == null || getClass() != o.getClass()) return false;        RolesEntity that = (RolesEntity) o;        if (idRole != that.idRole) return false;        if (role != null ? !role.equals(that.role) : that.role != null) return false;        if (roleName != null ? !roleName.equals(that.roleName) : that.roleName != null) return false;        return true;    }    @Override    public int hashCode() {        int result = (int) (idRole ^ (idRole >>> 32));        result = 31 * result + (role != null ? role.hashCode() : 0);        result = 31 * result + (roleName != null ? roleName.hashCode() : 0);        return result;    }}